  return (
    <body>
      <h1>P:LOW</h1>
      <img className="mainLogo" src="" width="150" height="150"></img>
      <br/>
      <Link to ="/user">
        <button className="main-btn">사용자</button>
      </Link>
      <Link to ="/institute">
        <button className="main-btn">조회 기관</button>
      </Link>
      <Link to ="blood">
        <button className="main-btn">헌혈 기관</button>
      </Link>
    </body>
  );
}

export default Main;
